DROP TABLE IF EXISTS `agent_house`;
CREATE TABLE `agent_house`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '房源 id',
  `listing_name` varchar(1024) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '房源 title',
  `first_upload_at` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '房源上架时间',
  `pricing` bigint(20) UNSIGNED NOT NULL COMMENT '报价，单位分',
  `squaremeter` int(11) NOT NULL COMMENT '建筑面积，单位平方米（需要除以 100）',
  `downpayment` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '首付，单位分',
  `floor` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '楼层',
  `total_floor` int(11) NULL DEFAULT NULL COMMENT '总楼层数',
  `dict_house_id` bigint(20) NULL DEFAULT NULL,
  `room_structure` int(11) NULL DEFAULT NULL,
  `ladder_ration` int(11) NULL DEFAULT NULL,
  `heating_type` int(11) NULL DEFAULT NULL,
  `house_duration` int(11) NULL DEFAULT NULL,
  `property_right` int(11) NULL DEFAULT NULL COMMENT '共有，非共有',
  `mortgage` int(11) NULL DEFAULT NULL,
  `usage_area` int(11) NULL DEFAULT NULL,
  `floor_level` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '楼层位置：1: 高 2:中 3:低',
  `facing_type` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '朝向分类，1：南北',
  `decoration_type` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '装修程度，1:简装 2:豪装',
  `building_type` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '楼型，TODO',
  `built_year` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '建造年代',
  `city_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `city_code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `neighborhood_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `neighborhood_source_code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '小区 id，neighborhood 主键',
  `floor_plan_room` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '卧室个数',
  `floor_plan_hall` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '厅个数',
  `floor_plan_bath` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '厕所个数',
  `floor_plan_kitchen` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '厨房个数',
  `house_type` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '房源类型，1: 新房 2: 二手房 3:租房',
  `layout_type` int(11) NULL DEFAULT 0 COMMENT '户型类型',
  `last_publish_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '房源更新时间',
  `ownership` int(11) NULL DEFAULT NULL COMMENT '交易权属: 1.商品房， 2. 公房，3.央产房，4.军产房，5.校产房， 6.私产，7. 经济适用房， 8.永久产权，9.空置房，10.使用权房，99.其他',
  `right_property` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '产权年限，多种以/分隔，如70年/40年/50年',
  `property_management_type` int(11) NULL DEFAULT NULL COMMENT '房屋类型 ，房屋类型: 1.普通住宅，2.别墅，3.写字楼， 4.商铺，5.商住两用，6.公寓，7.工业厂房，8.车库，9.经济适用房，99. 其他',
  `elevator` int(11) NULL DEFAULT NULL COMMENT '是否有电梯，0： 没有；1：有；null：未知',
  `house_status` int(11) NOT NULL DEFAULT 0 COMMENT '房源状态 0：正常；1：下架',
  `online_house_status` int(11) NULL DEFAULT NULL,
  `created_at` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `updated_at` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  `data_source_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '1：诸葛；2：安居客',
  `offline_code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '0' COMMENT '抓取房源 id',
  `source_code` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '离线房源编号',
  `start_version` int(11) NOT NULL,
  `last_version` int(11) NOT NULL,
  `crawl_id` bigint(20) UNSIGNED NOT NULL COMMENT '抓取id',
  `task_id` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT 'taskid',
  `house_card` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '',
  `online_neighborhood_id` bigint(20) NOT NULL DEFAULT 0,
  `online_city_id` int(11) NOT NULL DEFAULT 0,
  `online_district_id` int(11) NOT NULL DEFAULT 0,
  `online_area_id` int(11) NOT NULL DEFAULT 0,
  `property_only` int(11) NULL DEFAULT NULL COMMENT '唯一住房:1.是，0.否',
  `property_certificate_period` int(11) NULL DEFAULT NULL COMMENT '房本年限: 0.不满二，1.满二，2.满五，99.其他',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uniq_source_code_st_ver_lt_ver`(`source_code`, `start_version`, `last_version`) USING BTREE,
  INDEX `idx_created_at`(`created_at`) USING BTREE,
  INDEX `idx_updated_at`(`updated_at`) USING BTREE,
  INDEX `idx_offline_code_data_source_id`(`offline_code`, `data_source_id`) USING BTREE,
  INDEX `idx_neighborhood_code_lt_ver`(`neighborhood_source_code`, `last_version`) USING BTREE,
  INDEX `idx_crawl_id`(`crawl_id`) USING BTREE,
  INDEX `idx_city_name`(`city_name`) USING BTREE,
  INDEX `idx_data_source_id`(`data_source_id`) USING BTREE,
  INDEX `idx_dict_house_id`(`dict_house_id`) USING BTREE,
  INDEX `idx_house_card`(`house_card`) USING BTREE,
  INDEX `idx_online_house_status`(`online_house_status`) USING BTREE,
  INDEX `idx_online_neighborhood_id`(`online_neighborhood_id`) USING BTREE,
  INDEX `idx_online_city_id`(`online_city_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1973698705 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

